import React from 'react'; 
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import routes from "./config/routes"

import "./App.scss";
function App() {
  return (
    <Router>
      <Switch>
        <Route path={routes.path} exact={routes.exact} component = {routes.component}/>
      </Switch>
    </Router>
  );
}


export default App;
